import { Avatar, Card } from "antd";

const UserProfile = () => {
  return (
    <Card
      actions={[
        <div key="twit">짹짹</div>,
        <div key="following">팔로잉</div>,
        <div key="follower">팔로워</div>,
      ]}
    >
      <Card.Meta avatar={<Avatar>SI</Avatar>} title="Suin" />
    </Card>
  );
};

export default UserProfile;
